import React from 'react';
import './Home.css';
import captain from "../images/captain.jpeg";

/*
https://codepen.io/alvarotrigo/pen/XWeLOqE
*/

const Home = () => {
  return (
    <div className="home">
      <div className="tab-row">
        <div className="tab" id="tab1">me</div>
        <div className="tab" id="tab2">projects</div>
        <div className="tab" id="tab3">music</div>
        <div className="tab" id="tab4">art</div>
      </div>
      <img src="periodictable.png" alt="yo"/>
    </div>
  )
}

export default Home;

